import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

import PlayerPicksPage from './components/PlayerPicksPage';
import PrintablePage from './components/PrintableGamesPage'; // Corrected name
import ResultsPage from './components/ResultsPage';
import AdminUploadPage from './components/AdminUploadPage';
import AdminPicksPage from './components/AdminPicksPage';
// import HomePage from './components/HomePage'; // Commented out since not found

function App() {
  return (
    <Router>
      <Routes>
        {/* Home route is optional and can be changed to another existing component */}
        {/* <Route path="/" element={<HomePage />} /> */}
        <Route path="/" element={<ResultsPage />} />

        <Route path="/picks/week/:weekNumber" element={<PlayerPicksPage />} />
        <Route path="/print/week/:weekNumber" element={<PrintablePage />} />
        <Route path="/results" element={<ResultsPage />} />
        <Route path="/admin-upload" element={<AdminUploadPage />} />
        <Route path="/admin-picks" element={<AdminPicksPage />} />
      </Routes>
    </Router>
  );
}

export default App;
